import React from 'react'
import Header from '../components/Header';
import Footer from '../components/Footer'
import '../components/css/Home.css';

export default function About() {
    return (
        <div>
            <Header />
            <div class="about-container">
                <div>
                    <h2>About</h2>
                </div>
            </div>
            <Footer />            
        </div>
    )
}
